import React from 'react';
import './App.css';

import Nav from './components/Nav';
import Subjects from './components/Subjects';
import Teachers from './components/Teachers';
import Students from './components/Students';
import Periods from './components/Periods';

import {BrowserRouter as Router, Switch, Route} from 'react-router-dom';
import HomeDash  from './components/homeItems/HomeDash';
import ShowPeriod from './components/ShowPeriod';
//import Example from './components/Example';

function App() {
  return (
    <div className="container">
      <Nav/>
      <div className="text-center w-100">
      <h1>EELD</h1>
      <Router>
            <Route path="/" exact={true} component={HomeDash} />     
            <Route path="/alunos" exact={true} component={Students} />
            <Route path="/disciplinas" exact={true} component={Subjects} />
            <Route path="/professores" exact={true} component={Teachers} />
            <Route path="/periodos" component={Periods} />
            <Route path="/periodos/:id" exact={true} component={ShowPeriod} />
        </Router>
      <hr />   
    </div>
    </div>
  );
}

export default App;
